    function convertMinutesToTime(temp) {
    // Base time of 6:00 AM
    

 
    const hours = Math.floor(temp / 60);
     minutes = temp % 60;
  minutes= Math.round(minutes)
    // Format hours and minutes into "hh:mm"
    const formattedHours = String(hours).padStart(2, '0');
    const formattedMinutes = String(minutes).padStart(2, '0');
    
    return `${formattedHours}:${formattedMinutes}`;
}



function countOccurrences(arr, tolerancePercentage) {
    const counts = {};

    // Helper function to check if two numbers are within the tolerance percentage
    function isWithinTolerance(val1, val2) {
        const diff = Math.abs(val1 - val2);
        const tolerance = Math.max(Math.abs(val1), Math.abs(val2)) * (tolerancePercentage / 100);
        return diff <= tolerance;
    }

    // Helper function to find a matching key within the tolerance
    function findMatchingKey(pair) {
        for (const key in counts) {
            const [a, b] = key.split(',').map(Number);
            if (isWithinTolerance(pair[0], a) && isWithinTolerance(pair[1], b)) {
                return key;
            }
        }
        return null;
    }

    // Iterate through each pair in the array
    arr.forEach(pair => {
        const matchingKey = findMatchingKey(pair);
        if (matchingKey) {
            counts[matchingKey]++;
        } else {
            const key = `${pair[0]},${pair[1]}`;
            counts[key] = 1;
        }
    });

    // Format the result as an array of arrays
    const result = Object.keys(counts).map(key => {
        const [a, b] = key.split(',').map(Number);
        return [a, b, counts[key]];
    });

    return result;
}

  .append("g")
    .attr("transform",
          "translate(" + margin.left + "," + margin.top + ")");

// get the data
data = data.map(arr => (arr[1]))
data2 = gerundete_daten[ausgewaehltes_rennen].map(arr => (arr[1]))

  // X axis: scale and draw:
  var x = d3.scaleLinear()
      .domain([0, 6])     // can use this instead of 1000 to have the max of data: d3.max(data, function(d) { return +d.price })
      .range([0, width]);
  svg.append("g")
      .attr("transform", "translate(0," + height + ")")
      .call(d3.axisBottom(x));

  // set the parameters for the histogram
  var histogram = d3.histogram()
      .value(function(d) { return d; })   // I need to give the vector of value
      .domain(x.domain())  // then the domain of the graphic
      .thresholds(x.ticks(120)); // then the numbers of bins

  // And apply this function to data to get the bins
  var bins = histogram(data);
  var bins_red = histogram(data2);

  // Y axis: scale and draw:
  var y = d3.scaleLinear()
      .range([height, 0]);
      y.domain([0, d3.max(bins, function(d) { return d.length; })]);   // d3.hist has to be called before the Y axis obviously
  svg.append("g")
      .call(d3.axisLeft(y));

  // append the bar rectangles to the svg element
  svg.selectAll("rect")
      .data(bins)
      .enter()
      .append("rect")
        .attr("x", 1)
        .attr("transform", function(d) { return "translate(" + x(d.x0) + "," + y(d.length) + ")"; })
        .attr("width", function(d) { return x(d.x1) - x(d.x0) -1 ; })
        .attr("height", function(d) { return height - y(d.length); })
        .style("fill", "#69b3a2")
        var lineData = bins_red.map(function(d) {
        return { x: (d.x0 + d.x1) / 2, y: d.length };
    });

    // Create the line generator
    var line = d3.line()
        .x(function(d) { return x(d.x); })
        .y(function(d) { return y(d.y); });

    // Append the line to the SVG
    svg.append("path")
        .datum(lineData)
        .attr("fill", "none")
        .attr("stroke", "red")
        .attr("stroke-width", 0.5)
        .attr("d", line);

}


</script>

</html>
